package com.tddair;

public class Member {
	
	String identifier;
	String email;

	public Member(String identifier, String email) {
		this.identifier = identifier;
		this.email = email;
	}

	public String getIdentifier() {
		// TODO Auto-generated method stub
		return identifier;
	}

	public String getEmail() {
		// TODO Auto-generated method stub
		return email;
	}

}
